import React from 'react';
import { Link } from 'react-router-dom';
import { FaHome } from 'react-icons/fa';

const Header = () => {
  return (
    <header className="sticky-header">
      <div
        style={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '0 20px',
        }}
      >
        <Link
          to="/"
          style={{
            textDecoration: 'none',
            color: '#fff',
            fontSize: '24px',
            fontWeight: 'bold',
          }}
        >
          OVERTIME
        </Link>
        <Link to="/" style={{ color: '#aaa' }}>
          <FaHome size={24} />
        </Link>
      </div>
    </header>
  );
};

export default Header;
